      font-weight: bold;
      font-family: 'Arial', sans-serif;
      text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
      padding-bottom: 10px;
      display: inline-block;
      margin-bottom: 30px;
    }
    .form-container h1 {
      font-size: 36px;
      color: #2c3e50;
      border-bottom: 3px solid #3498db;
    }
    .form-container h2 {
      font-size: 30px;
      color: #c95355;
      border-bottom: 3px solid #f12349;
    }
    .form-container form {
      background-color: #f9f9f9;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    }
    .form-container form div {
      margin-bottom: 15px;
    }
    .form-container form label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
      text-transform: capitalize;
    }
    .form-container form input, .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
    }
    .form-container form .submit-row {
      text-align: center;
      margin-top: 20px;
    }
    .form-container form input[type="submit"] {
      background-color: #000 !important;
      color: #fff !important;
      padding: 12px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }
    .form-container form input[type="submit"]:hover {
      background-color: #444;
      color: #fff;
    }
    .form-container form select {
      background-color: #fff;
      font-size: 16px;
      cursor: pointer;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      background-image: url('data:image/svg+xml;utf8,<svg fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M7.68 11.895a.75.75 0 0 1-1.06-1.06L7.94 9.44V5.75a.75.75 0 0 1 1.5 0v3.69l1.32 1.33a.75.75 0 0 1-1.06 1.06L8 10.56l-.32.32z"/></svg>');
      background-repeat: no-repeat;
      background-position: right 10px top 50%, 0 0;
      background-size: 16px auto, 100%;
    }
    .radio-group {
      display: flex;
      align-items: center;
      gap: 15px;
    }
    .radio-group input[type="radio"] {
      margin-right: 5px;
    }
    .radio-group label {
      margin: 0;
    }
    .checkbox-group {
      display: flex;
      flex-wrap: wrap;
      gap: 10px;
    }
    .checkbox-group label {
      display: flex;
      align-items: center;
      gap: 5px;
    }
  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()">
      <h1>Complication de la drepanocytose</h1>
      <div *ngFor="let complication of complications; let i = index">
        <h2>  Aggravation de l'anémie            - {{ i + 1 }}</h2>
      
        <!-- Aggravation de l'anémie -->
        <div>
          <label>Aggravation de l'anémie:</label>
          <div class="radio-group">
            <input type="radio" id="AgOui-{{i}}" [(ngModel)]="complication.aggravationAnemie" [value]="true" name="AggravationAnemie-{{i}}">
            <label for="AgOui-{{i}}">Oui</label>
            <input type="radio" id="AgNon-{{i}}" [(ngModel)]="complication.aggravationAnemie" [value]="false" name="AggravationAnemie-{{i}}">
            <label for="AgNon-{{i}}">Non</label>
          </div>
        </div>

        <!-- Nombre -->
        <div *ngIf="complication.aggravationAnemie">
          <label for="Nombre-{{i}}">Nombre:</label>
          <input type="number" id="Nombre-{{i}}" [(ngModel)]="complication.nombre" name="Nombre-{{i}}">
        </div>

        <!-- Date -->
        <div *ngIf="complication.aggravationAnemie">
          <label for="Date-{{i}}">Date :</label>
          <input type="date" id="Date-{{i}}" [(ngModel)]="complication.date" name="Date-{{i}}">
        </div>

        <!-- Symptomatologie -->
        <div class="conditional-fields" *ngIf="complication.aggravationAnemie">
            <label for="Symptomatologie-{{i}}">Symptomatologie:</label>
            <div class="checkbox-group">
              <label>
                <input type="checkbox" id="AggravationPaleur-{{i}}" [(ngModel)]="complication.aggravationPaleur" name="AggravationPaleur-{{i}}">
                Aggravation de la Paleur
              </label>
              <label>
                <input type="checkbox" id="AggravationIctere-{{i}}" [(ngModel)]="complication.aggravationIctere" name="AggravationIctere-{{i}}">
                Aggravation d'Ictere
              </label>
              <label>
                <input type="checkbox" id="Fievre-{{i}}" [(ngModel)]="complication.fievre" name="Fievre-{{i}}">
                Fievre
              </label>
              <label>
                <input type="checkbox" id="UrinesPlusFoncee-{{i}}" [(ngModel)]="complication.urinesPlusFoncee" name="UrinesPlusFoncee-{{i}}">
                Urines Plus Foncées
              </label>
              <label>
                <input type="checkbox" id="AugmentationVolumeRate-{{i}}" [(ngModel)]="complication.augmentationVolumeRate" name="AugmentationVolumeRate-{{i}}">
                Augmentation Volume Rate
              </label>
              <label>
                <input type="number" id="PreciserAvr-{{i}}" [(ngModel)]="complication.preciserAvr" name="PreciserAvr-{{i}}">
                Volume Rate (cm)
              </label>
              <label>
                <input type="checkbox" id="SigneChoc-{{i}}" [(ngModel)]="complication.signeChoc" name="SigneChoc-{{i}}">
                Signe de Choc  
              </label>
              <label>
                <input type="checkbox" id="Autre-{{i}}" [(ngModel)]="complication.autre" name="Autre-{{i}}">
                Autre
              </label>
            </div>
          </div>
          <!-- Preciser autre -->
        <div *ngIf="complication.aggravationAnemie && complication.autre">
            <label for="PreciserAutre-{{i}}">Preciser Autre:</label>
            <input type="text" id="PreciserAutre-{{i}}" [(ngModel)]="complication.preciserAutre" name="PreciserAutre-{{i}}">
          </div>

         
          <!-- Hémogramme -->
        <div *ngIf="complication.aggravationAnemie">
            <label for="Hemogramme-{{i}}">Hemogramme:</label>
            <input type="number" id="Hemogramme-{{i}}" [(ngModel)]="complication.hemogramme" name="Hemogramme-{{i}}">
          </div>

          <div *ngIf="complication.aggravationAnemie">
            <label for="Hb-{{i}}">Hb (g/dl):</label>
            <input type="number" id="Hb-{{i}}" [(ngModel)]="complication.hb" name="Hb-{{i}}">
          </div>

          <div *ngIf="complication.aggravationAnemie">
            <label for="Recticulocytes-{{i}}">Reticulocytes(/mm3):</label>
            <input type="number" id="Recticulocytes-{{i}}" [(ngModel)]="complication.recticulocytes" name="Recticulocytes-{{i}}">
          </div>
          <div *ngIf="complication.aggravationAnemie">
            <label for="Pnn-{{i}}">PNN(/mm3):</label>
            <input type="number" id="Pnn-{{i}}" [(ngModel)]="complication.pnn" name="Pnn-{{i}}">
          </div>
          <div *ngIf="complication.aggravationAnemie">
            <label for="Plaquettes-{{i}}">Plaquettes(/mm3):</label>
            <input type="number" id="Plaquettes-{{i}}" [(ngModel)]="complication.plaquettes" name="Plaquettes-{{i}}">
          </div>
        <!-- Lieu hospitalisation -->
        <div *ngIf="complication.aggravationAnemie">
          <label for="LieuHospitalisation-{{i}}">Lieu Hospitalisation:</label>
          <input type="text" id="LieuHospitalisation-{{i}}" [(ngModel)]="complication.lieuHospitalisation" name="LieuHospitalisation-{{i}}">
        </div>

        <!-- Traitement -->
        <div class="conditional-fields" *ngIf="complication.aggravationAnemie">
          <label for="Traitement-{{i}}">Traitement:</label>
          <div class="checkbox-group">
            <label>
              <input type="checkbox" id="AntalgiquesPalliesI-{{i}}" [(ngModel)]="complication.antalgiquesPalliesI" name="AntalgiquesPalliesI-{{i}}">
              Antalgiques pallier I
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIi-{{i}}" [(ngModel)]="complication.antalgiquePallierIi" name="AntalgiquePallierIi-{{i}}">
              Antalgique pallier II
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIii-{{i}}" [(ngModel)]="complication.antalgiquePallierIii" name="AntalgiquePallierIii-{{i}}">
              Antalgique pallier III
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationPerso-{{i}}" [(ngModel)]="complication.hyperhydratationPerso" name="HyperhydratationPerso-{{i}}">
              Hyperhydratation perso
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationIv-{{i}}" [(ngModel)]="complication.hyperhydratationIv" name="HyperhydratationIv-{{i}}">
              Hyperhydratation IV
            </label>
            <label>
              <input type="checkbox" id="TransfusionSimple-{{i}}" [(ngModel)]="complication.transfusionSimple" name="TransfusionSimple-{{i}}">
              Transfusion simple
            </label>
            <label>
                <input type="checkbox" id="AutreTraitement-{{i}}" [(ngModel)]="complication.autreTraitement" name="AutreTraitement-{{i}}">
                Autre
            </label>
            <div *ngIf="complication.aggravationAnemie && complication.autreTraitement">
                <label for="PreciserAutreTraitement-{{i}}">Preciser:</label>
                <input type="text" id="PreciserAutreTraitement-{{i}}" [(ngModel)]="complication.preciserAutreTraitement" name="PreciserAutreTraitement-{{i}}">
            </div>
          </div>
        </div>
  <!-- Sequelles -->
  <div *ngIf="complication.aggravationAnemie">
    <label for="DiagnosticPresume-{{i}}">Diagnostic présumé:</label>
    <select type="text" id="DiagnosticPresume-{{i}}" [(ngModel)]="complication.diagnosticPresume" name="DiagnosticPresume-{{i}}">
        <option value="Séquestration splénique">Séquestration splénique</option>
        <option value="Erythroblastopénie">Erythroblastopénie</option>
        <option value="Hyper hémolyse        ">Hyper hémolyse</option>
    </select>
    </div>
      </div>
      
      <div class="submit-row">
        <input type="button" (click)="addComplication()" value="Ajouter Crise ">
      </div>
      <div class="submit-row">
        <input type="submit" value="Mettre à jour">
      </div>
    </form>
  </div>
</body>
</html>
